import './Footer.css'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import React from 'react';  

function Footer() {
    return ( 
        <footer id='footer'>
              <div className='top-footer'>
                  <div className='container'></div>
              </div>
              <div className='bottom-footer'></div>
        </footer>
    );
        

    
}
export default Footer;
